import React from "react";

const ColoredBox = ({ color, setSpalva }) => {
  let bgColor = {
    backgroundColor: color.hex,
  };

  return (
    <div onClick={() => setSpalva(color.hex)} className="boxes" style={bgColor}>
      {color.name}
    </div>
  );
};

export default ColoredBox;
